};
const UpcomingInterviews = () => {
  const UpcomingInterviewsApp = (props) => {
    return (
      <>
        <div className="col-12">
          <NavLink to="/">
            <div className="upcoming_interviews_main_div_inner">
              <div className="row">
                <div className="col-6">
                  <div className="upcoming_interviews_icon_div">
                    <Image
                      className="upcoming_interviews_icon"
                      backgroundImage={props.UserImg}
                    />
                    <div className="upcoming_interviews_icon_div_text">
                      <h5>{props.UserName}</h5>
                      <p>{props.UserJobTitle}</p>
                    </div>
                  </div>
                </div>
                <div className="col-6">
                  <div className="upcoming_interviews_time">
                    <p>
                      <span>
                        <AiOutlineClockCircle />
                        {props.time}
                      </span>
                    </p>
                  </div>
                </div>
              </div>
              <ul className="upcoming_interviews_ul">
                <li>{props.HrName}</li>
                <li>{props.TlName}</li>
              </ul>
            </div>
          </NavLink>
        </div>
      </>
    );
  };
  const SettingsBottomBtnData = [
    {
      UserImg: ProfileIcon,
      UserName: "Jan Mik",
      UserJobTitle: "UX Designer",
      time: "10:00-12:45",
      HrName: "Gaurav Kaushik",
      TlName: "	Akhilesh Soni",
    },
    {
      UserImg: ProfileIcon,
      UserName: "Jan Mik",
      UserJobTitle: "UX Designer",
      time: "10:00-12:45",
      HrName: "Gaurav Kaushik",
      TlName: "	Akhilesh Soni",
    },
    {
      UserImg: ProfileIcon,
      UserName: "Jan Mik",
      UserJobTitle: "UX Designer",
      time: "10:00-12:45",
      HrName: "Gaurav Kaushik",
      TlName: "	Akhilesh Soni",
    },
    {
      UserImg: ProfileIcon,
      UserName: "Jan Mik",
      UserJobTitle: "UX Designer",
      time: "10:00-12:45",
      HrName: "Gaurav Kaushik",
      TlName: "	Akhilesh Soni",
    },
  ];
  return (
    <>
      <div className="upcoming_interviews_main_div">
        <div className="upcoming_interviews_top_title_div">
          <h3>Upcoming Interviews</h3>
        </div>
        <div className="upcoming_interviews_overflow">
          <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
            {SettingsBottomBtnData.map((val, i) => {
              return (
                <UpcomingInterviewsApp
                  key={i}
                  UserImg={val.UserImg}
                  UserName={val.UserName}
                  UserJobTitle={val.UserJobTitle}
                  time={val.time}
                  HrName={val.HrName}
                  TlName={val.TlName}
                />
              );
            })}
          </div>
        </div>
      </div>
    </>
  );
};
export const WorkingTimeChart = () => {
  const [state] = useState({
    series: [
      {
        name: "Overtime",
        type: "column",
        data: [11, 30, 71],
      },
      {
        name: "Working Time",
        type: "column",
        data: [20, 59, 57],
      },
      {
        name: "Working Time",
        type: "column",
        data: [30, 49, 40],
      },
      {
        name: "Working Time",
        type: "column",
        data: [10, 29, 47],
      },
    ],
    options: {
      colors: ["#F43D03", "#900F9B", "#E41662", "#0043CE"],
      chart: {
        type: "line",
        stacked: false,
        toolbar: {
          show: false,
        },
      },
      dataLabels: {
        enabled: false,
      },
      stroke: {
        width: [1, 1, 4],
      },
      xaxis: {
        categories: ["Maxlence", "Linkedin", "Internshala"],
      },
      legend: {
        show: true,
        position: "top",
        horizontalAlign: "right",
        fontSize: "15px",
        markers: {
          width: 12,
          height: 12,
          radius: 0,
          offsetX: -10,
          offsetY: 0,
        },
        itemMargin: {
          horizontal: 40,
          vertical: 0,
        },
      },
      bar: {
        barWidth: "10%",
      },
    },
  });
  const options = [
    { value: "today", label: "today" },
    { value: "tomorrow", label: "tomorrow" },
    { value: "last week", label: "last week" },
  ];
  return (
    <>
      <ReactApexChart
        options={state.options}
        series={state.series}
        type="line"
        height={300}
      />
    </>
  );
};
